import React from 'react';


function Filters() {
  return (
  <>
  <h1>CATEGORIES</h1>
	  <div className="check">
			 <input type="checkbox" /> Flip Flops
			 <input type="checkbox" /> Sneakers
			 <input type="checkbox" /> Lace-Up shoes
			 <input type="checkbox" /> Shoe Accessories
	 </div>
	 <hr/>
  </>
  );
}

export default Filters;
